import {BrowserRouter, Route, Switch} from 'react-router-dom';
import SignUp from './components/SignUp';
import SignIn from './components/SignIn';


function App() {
  return (
    <div className='App'>
      <Router>
        <Route path="/" component={SignUp}/>
        <Route path="/signin" component={SignIn}/>
      </Router>
    </div>
  );
}

export default App;
